import React from "react";

import { Nav, NavbarContainer, NavLogo } from "./NavbarElements";

const Navbar = () => {
  return (
    <>
      <Nav>
        <NavbarContainer>
          <NavLogo to="/">K and R 5 Star Events</NavLogo>
          <Image></Image>
        </NavbarContainer>
      </Nav>
    </>
  );
};

export default Navbar;
